Продам 2кв. по ул.Трегубова 36  4/5 42/29/6,4 
 Шесть причин, почему Вам стоит купить эту квартру:
-квартира не испорчена ремонтом ;
- комнаты &quot;трамвай&quot; - легко перепланируется , 
- развита инфраструктура- рядом магазины, рынок, школа, д.сад;
-остановка общественного транспорта в 2 мин.
